import React from "react";
import "../component/Navbar.css";

function Navbar() {
  return (
    <div className="nav">
      <img src="https://upload.wikimedia.org/wikipedia/commons/0/08/Netflix_2015_logo.svg" alt="Netflix Logo" className="nav__logo"/>
    </div>
  );
}

export default Navbar;
